package com.adventofcode.dec2018.day5

class PolymerReactor {
    fun processReactions(input: String): String {
        var reacted: Boolean
        var initial = input
        var processed: StringBuilder
        do {
            reacted = false
            processed = StringBuilder()
            var i = 0
            while (i < initial.length) {
                if (i + 1 < initial.length && areOpposites(initial[i], initial[i + 1])) {
                    reacted = true
                    i++
                } else {
                    processed.append(initial[i])
                }
                i++
            }
            initial = processed.toString()
        } while (reacted)
        return processed.toString()
    }

    fun areOpposites(a: Char, b: Char): Boolean {
        val min = minOf(a, b)
        val max = maxOf(a, b)
        return min + 32 == max
    }

    fun optimizePolymer(input: String): Int =
            input.toUpperCase()
                    .toByteArray()
                    .map { it.toChar() }
                    .distinct()
                    .map { c -> processReactions(input.filter { it != c && it != c + 32 }).length }
                    .minOrNull() ?: 0

}

fun main() {
    val input = ""
    val reactor = PolymerReactor()
    println("Result: ${reactor.processReactions(input).length}")
    println("Optimized result: ${reactor.optimizePolymer(input)}")
}
